void print_list(node head)
{
  UNITY_LINE_TYPE cmock_line = TEST_LINE_NUM;
  CMOCK_print_list_CALL_INSTANCE* cmock_call_instance;
  UNITY_SET_DETAIL(CMockString_print_list);
  cmock_call_instance = (CMOCK_print_list_CALL_INSTANCE*)CMock_Guts_GetAddressFor(Mock.print_list_CallInstance);
  Mock.print_list_CallInstance = CMock_Guts_MemNext(Mock.print_list_CallInstance);
  if (Mock.print_list_IgnoreBool)
  {
    UNITY_CLR_DETAILS();
    return;
  }
  if (!Mock.print_list_CallbackBool &&
      Mock.print_list_CallbackFunctionPointer != NULL)
  {
    Mock.print_list_CallbackFunctionPointer(head, Mock.print_list_CallbackCalls++);
    UNITY_CLR_DETAILS();
    return;
  }
  UNITY_TEST_ASSERT_NOT_NULL(cmock_call_instance, cmock_line, CMockStringCalledMore);
  cmock_line = cmock_call_instance->LineNumber;
  if (cmock_call_instance->CallOrder > ++GlobalVerifyOrder)
    UNITY_TEST_FAIL(cmock_line, CMockStringCalledEarly);
  if (cmock_call_instance->CallOrder < GlobalVerifyOrder)
    UNITY_TEST_FAIL(cmock_line, CMockStringCalledLate);
  {
    UNITY_SET_DETAILS(CMockString_print_list,CMockString_head);
    UNITY_TEST_ASSERT_EQUAL_MEMORY((void*)(&cmock_call_instance->Expected_head), (void*)(&head), sizeof(node), cmock_line, CMockStringMismatch);
  }
  if (Mock.print_list_CallbackFunctionPointer != NULL)
  {
    Mock.print_list_CallbackFunctionPointer(head, Mock.print_list_CallbackCalls++);
  }
  UNITY_CLR_DETAILS();
}

