void CMockExpectParameters_print_list(CMOCK_print_list_CALL_INSTANCE* cmock_call_instance, node head)
{
  memcpy((void*)(&cmock_call_instance->Expected_head), (void*)(&head),
         sizeof(node[sizeof(head) == sizeof(node) ? 1 : -1])); /* add node to :treat_as_array if this causes an error */
}

